window.bookSummaryJSON = "<p>Avery, Ax, Falcon, Cosmo, and I had stumbled upon something suspicious; something that was going on in my city right under our noses. A new drug had popped up, affecting only the paranormal community. People were starting to go missing, and those that we caught started babbling about how <i>he</i> was going to take the Syndicate down for good.</p> <p>That was never going to happen. No one ruled the criminal world but us, and we don’t mind making a mess of anyone who stands in our way.</p> <p>Following a bloody battle, I was saved by someone I never thought I would see again, someone who was supposed to be dead. Someone who <i>belonged</i> to the Syndicate.</p> <p>I <i>needed</i> to get him back.</p> <p>Right as we began to unravel some leads for both our missing heir and the drug problem, my dad and the other bosses went missing. <i>Can’t a girl catch a break?</i></p> <p>We needed to get our dads back, we needed to stop whoever was controlling these drugs, and most of all, these heirs better fall in line because I am Rayla Desmond, the Syndicate Queen, and I don't need any Kings.</p> <p>Check TW on KiraStanleyAuthor.com</p>"; 
